import axios from 'axios'
import { authHeader } from '../helpers/authservice/auth-header';



class CountryDataService {

    getAll(fields, sorts, pages) {

        let dataVals = {
            fields: fields,
            sorts: sorts,
            Pages: pages
        };


        let config = {
            headers: authHeader(),

        }

        console.log(config)

        return axios.post('/api/v2/products/get', dataVals, config)

    }

    get(id) {
        return axios.post(`/api/v2/product/get/${id}`);
    }

    create(data) {
        let config = {
            headers: authHeader()
        }
        console.log(config)
        return axios.post("/api/v2/products/create", data, config);
    }

    update(id, data) {
        return axios.put(`/api/v2/product/update/${id}`, data);
    }

    delete(id) {
        return axios.delete(`/api/v2/product/delete${id}`);
    }

    deleteAll() {
        return axios.delete(`/api/v2/products/delete`);
    }

    findByTitle(title) {
        return axios.get(`/api/v2/products?title=${title}`, config);
    }
}

export default new CountryDataService();
